description:
Are you willing to follow Jesus wherever He goes? Read with us through REVELATION 14 and learn what it means for the 144,000, firstfruits unto God, to follow Jesus wherever He goes. Consider a number of angels throughout our study, and their roles leading to the reaping of an overripe earth.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
